DROP DATABASE IF EXISTS vk;
CREATE DATABASE vk;
USE vk;

DROP TABLE IF EXISTS users;
CREATE TABLE users (
	id SERIAL PRIMARY KEY,
	email VARCHAR(120) UNIQUE,
    phone VARCHAR(15), 
    pass VARCHAR(200)
);

DROP TABLE IF EXISTS profiles;
CREATE TABLE profiles (
	id SERIAL PRIMARY key,
	user_id BIGINT UNSIGNED NOT NULL,
    gender CHAR(1),
    name VARCHAR(100),
    surname VARCHAR(100),
    birthday DATE,
	photo_id BIGINT UNSIGNED NULL,
    created_at DATETIME DEFAULT NOW(),
    hometown VARCHAR(100),
    -- bio TEXT,
    FOREIGN KEY (user_id) REFERENCES users(id)
);


DROP TABLE IF EXISTS messages;
CREATE TABLE messages (
	id SERIAL PRIMARY KEY,
	from_user_id BIGINT UNSIGNED NOT NULL,
    to_user_id BIGINT UNSIGNED NOT NULL,
    body TEXT,
    is_read BOOL,
    created_at DATETIME default NOW(),
    INDEX(from_user_id),
  	INDEX(to_user_id),
  	FOREIGN KEY (from_user_id) REFERENCES users(id),
  	FOREIGN KEY (to_user_id) REFERENCES users(id)
);

DROP TABLE IF EXISTS friend_requests;
CREATE TABLE friend_requests (
	initiator_user_id BIGINT UNSIGNED NOT NULL,
	target_user_id BIGINT UNSIGNED NOT NULL,
	satus ENUM('requested', 'approved', 'unfriended', 'declined') default 'requested',
	requested_at DATETIME DEFAULT NOW(),
	confirmed_at DATETIME,
	PRIMARY KEY(initiator_user_id, target_user_id),
	index(initiator_user_id),
	index(target_user_id),
	FOREIGN KEY (initiator_user_id) REFERENCES users(id),
  	FOREIGN KEY (target_user_id) REFERENCES users(id)
);

DROP TABLE IF EXISTS communities;
CREATE TABLE communities(
	id SERIAL PRIMARY KEY,
	name VARCHAR(255),
	INDEX(name)
);

DROP TABLE IF EXISTS users_communities;
CREATE TABLE users_communities(
	user_id BIGINT UNSIGNED NOT NULL,
	community_id BIGINT UNSIGNED NOT NULL,
	is_admin BOOL,
	PRIMARY KEY (user_id, community_id), 
  	FOREIGN KEY (user_id) REFERENCES users(id),
  	FOREIGN KEY (community_id) REFERENCES communities(id)
);

DROP TABLE IF EXISTS posts;
CREATE TABLE posts(
	id SERIAL PRIMARY KEY,
	user_id BIGINT UNSIGNED NOT NULL,
	body text,
	attachments JSON,
	metadata JSON,
	created_at DATETIME DEFAULT NOW(),
	updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	FOREIGN KEY (user_id) REFERENCES users(id)	
);

DROP TABLE IF EXISTS comments;
CREATE TABLE comments(
	id SERIAL PRIMARY KEY,
	user_id BIGINT UNSIGNED NOT NULL,
	post_id BIGINT UNSIGNED NOT NULL,
	body text,
	created_at DATETIME DEFAULT NOW(),
	updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	FOREIGN KEY (user_id) REFERENCES users(id),
	FOREIGN KEY (post_id) REFERENCES posts(id)
);

DROP TABLE IF EXISTS photo;
CREATE TABLE photo(
	id SERIAL PRIMARY KEY,
	file VARCHAR(255),
	user_id BIGINT UNSIGNED NOT NULL,
	description text,
	created_at DATETIME DEFAULT NOW(),
	updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	FOREIGN KEY (user_id) REFERENCES users(id)
);

DROP TABLE IF EXISTS likes_photo;
CREATE TABLE likes_photo(
id SERIAL PRIMARY KEY,
photo_id BIGINT UNSIGNED NOT NULL,
profile_id BIGINT UNSIGNED NOT NULL,
created_at DATETIME DEFAULT NULL,
FOREIGN KEY (profile_id) REFERENCES profiles(id),
FOREIGN KEY (photo_id) REFERENCES photo(id)
);

DROP TABLE IF EXISTS repost;
CREATE TABLE repost(
	id SERIAL PRIMARY KEY,
	post_id BIGINT UNSIGNED NOT NULL,
	reposted_to BIGINT UNSIGNED NOT NULL,
	reposted_from BIGINT UNSIGNED NOT NULL,
	reposted_at DATETIME DEFAULT NOW(),
	FOREIGN KEY (reposted_to) REFERENCES users(id),
	FOREIGN KEY (post_id) REFERENCES posts(id)
);

create table MOCK_DATA (
	id VARCHAR(50),
	profiles VARCHAR(50),
	messages VARCHAR(50),
	friend_requests VARCHAR(50),
	communities VARCHAR(1000),
	users_communities VARCHAR(1000),
	ip_address VARCHAR(20),
	posts VARCHAR(50),
	comments VARCHAR(50),
	photo VARCHAR(50),
	likes_photo VARCHAR(50),
	repost VARCHAR(1000)
);

